import React, { Component } from 'react';
import "./style.css";
import Close from "./close/index.js";
import Search from "./search/index.js";




class Modal extends Component {
    render () {
        return (
            <div className="modal-container">
                <Close />
                <Search />
            </div>
        );
    }
}


